function explicitOwnershipOf(uint256 tokenId)
    public
    view
    returns (IERC721AUpgradeable.TokenOwnership memory ownership)
{
    // If the tokenId is outside the valid range, return a default (all-zero) struct.
    if (tokenId < _startTokenId() || tokenId >= _nextTokenId()) {
        return ownership;
    }

    // Read the stored ownership data. This may be an uninitialized (zero) slot.
    ownership = _ownershipAt(tokenId);

    // If the token has been burned, the stored ownership is authoritative.
    if (ownership.burned) {
        return ownership;
    }

    // If the slot is not explicitly set, walk backwards until we find the most
    // recent initialized ownership record.
    if (ownership.addr == address(0)) {
        while (true) {
            unchecked {
                --tokenId;
            }
            ownership = _ownershipAt(tokenId);
            if (ownership.addr != address(0)) {
                return ownership;
            }
        }
    }

    return ownership;
}

